import React from "react";
import { Routes, Route, Navigate, NavLink, useRoutes } from "react-router-dom";

import Home from "./pages/Home";
import About from "./pages/About";

import "./App.css";

const element = useRoutes([

  { path: "/home", element: <Home />, },

  { path: "/about", element: <About /> },
  { path: "/", element: <Navigate to="/about" /> },
]);

export default function App() {
  const aa = () => {
    console.log("123");
  };
  const computedClassName = ({ isActive }) => {
    console.log(isActive);
    return isActive ? "colorRed" : "";
  };

  return (
    <div>
      <h1>庄子·逍遥游丨</h1>
      <div id="main">
        <div id="left">
          <ul>
            <li>
              <NavLink className={computedClassName} to="/home">
                Home
              </NavLink>
            </li>
            <li>
              <NavLink className={computedClassName} to="/about">
                About
              </NavLink>
            </li>
          </ul>
        </div>
        <div id="right">
          <Routes>
            <Route path="/home" element={<Home a={"123"} />} />
            <Route path="/about" element={<About />} />
            <Route path="/" element={<Navigate to="/about" />} />
          </Routes>
        </div>
      </div>
    </div>
  );
}
